import React from 'react';
import '../../../App.css';
import Footer from '../../Footer';
import Navbar from '../../Navbar';
import './print_card.css'

function Print_card() {
    return (
      <>
        <Navbar
        NavPage='profile'/>

<div class="container">

  <div class="title">Health Card</div>
  <div class="content">

      <div class="card_container">

      <div class="padding">
                <div class="font">
                    <div class="top">
                        <img src="download.png"/>
                    </div>
                    <div class="bottom">
                        <p>Zihadul Islam</p>
                        <p class="desi">1911201</p>
                    </div>
                </div>
            </div>

      </div>



  </div>
</div>

        <Footer/>
      </>
    );
  }

  export default Print_card;
